{
  "name": "UBX-LOG-INFO",
  "class_id": "0x21",
  "message_id": "0x08",
  "description": "This message is used to report information about the logging subsystem.",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 48
    },
    "fields": [
      {
        "name": "version",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message version (0x01 for this version)"
      },
      {
        "name": "reserved0",
        "byte_offset": 1,
        "data_type": {
          "array_of": "U1",
          "count": 3
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "filestoreCapacity",
        "byte_offset": 4,
        "data_type": "U4",
        "description": "The capacity of the filestore",
        "unit": "bytes"
      },
      {
        "name": "reserved1",
        "byte_offset": 8,
        "data_type": {
          "array_of": "U1",
          "count": 8
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "currentMaxLogSize",
        "byte_offset": 16,
        "data_type": "U4",
        "description": "The maximum size the current log is allowed to grow to",
        "unit": "bytes"
      },
      {
        "name": "currentLogSize",
        "byte_offset": 20,
        "data_type": "U4",
        "description": "Approximate amount of space in log currently occupied",
        "unit": "bytes"
      },
      {
        "name": "entryCount",
        "byte_offset": 24,
        "data_type": "U4",
        "description": "Number of entries in the log. Note: for circular logs this value will decrease when a group of entries is deleted to make space for new ones."
      },
      {
        "name": "oldestYear",
        "byte_offset": 28,
        "data_type": "U2",
        "description": "Oldest entry UTC year (1-65635) or zero if there are no entries with known time"
      },
      {
        "name": "oldestMonth",
        "byte_offset": 30,
        "data_type": "U1",
        "description": "Oldest month (1-12)"
      },
      {
        "name": "oldestDay",
        "byte_offset": 31,
        "data_type": "U1",
        "description": "Oldest day (1-31)"
      },
      {
        "name": "oldestHour",
        "byte_offset": 32,
        "data_type": "U1",
        "description": "Oldest hour (0-23)"
      },
      {
        "name": "oldestMinute",
        "byte_offset": 33,
        "data_type": "U1",
        "description": "Oldest minute (0-59)"
      },
      {
        "name": "oldestSecond",
        "byte_offset": 34,
        "data_type": "U1",
        "description": "Oldest second (0-60)"
      },
      {
        "name": "reserved2",
        "byte_offset": 35,
        "data_type": "U1",
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "newestYear",
        "byte_offset": 36,
        "data_type": "U2",
        "description": "Newest year (1-65635) or zero if there are no entries with known time"
      },
      {
        "name": "newestMonth",
        "byte_offset": 38,
        "data_type": "U1",
        "description": "Newest month (1-12)"
      },
      {
        "name": "newestDay",
        "byte_offset": 39,
        "data_type": "U1",
        "description": "Newest day (1-31)"
      },
      {
        "name": "newestHour",
        "byte_offset": 40,
        "data_type": "U1",
        "description": "Newest hour (0-23)"
      },
      {
        "name": "newestMinute",
        "byte_offset": 41,
        "data_type": "U1",
        "description": "Newest minute (0-59)"
      },
      {
        "name": "newestSecond",
        "byte_offset": 42,
        "data_type": "U1",
        "description": "Newest second (0-60)"
      },
      {
        "name": "reserved3",
        "byte_offset": 43,
        "data_type": "U1",
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "status",
        "byte_offset": 44,
        "data_type": "X1",
        "description": "Log status flags",
        "bitfield": {
          "bits": [
            {
              "name": "recording",
              "bit_start": 3,
              "bit_end": 3,
              "description": "Log entry recording is currently turned on"
            },
            {
              "name": "inactive",
              "bit_start": 4,
              "bit_end": 4,
              "description": "Logging system not active - no log present"
            },
            {
              "name": "circular",
              "bit_start": 5,
              "bit_end": 5,
              "description": "The current log is circular"
            }
          ]
        }
      },
      {
        "name": "reserved4",
        "byte_offset": 45,
        "data_type": {
          "array_of": "U1",
          "count": 3
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}
